          .data(veri)
          .enter()
          .append(""rect"")
          .attr(""class"", ""bar"")
          .attr(""y"", function (d) {
            return y(d.oy_turu);
          })
          .attr(""height"", y.bandwidth())
          .attr(""x"", 0)
          .attr(""width"", 0)
          .attr(""fill"", renk) // Parametre olarak gelen renk kullanılıyor
          .transition()
